import styled from "styled-components";

const Box = styled.div`
    width: 400px;
    min-width: 400px;
    height: 220px;
    background-color: #999;
    background-image: url("https://i.pinimg.com/474x/17/12/c9/1712c9ec77f883ee3f7d703e4d8f997f.jpg");
    margin: 40px;

    border-radius: 7px;
    box-shadow: 2px 2px 4px #999;
`;

const PosterDiv = styled.div``;
const ContentDiv = styled.div``;

const MovieBox = () => {
    return (
        <Box>
            <PosterDiv></PosterDiv>
        </Box>
    )
};

export default MovieBox;
